      Event3:
          type: Observation:moon
          description: The lunar nodes are the orbital nodes of the Moon – that is – the points where the orbit of the Moon crosses the ecliptic. The ascending node is where the moon crosses from south of the ecliptic to north of the ecliptic. The descending node is where it crosses from north of the ecliptic to south of the ecliptic.
          date: "2016-11-22"
          title: Moon Ascending Node
          keyName: Moon Ascending Node
